import "./styles.css";

export default function Card({
  nome,
  logo,
  estado,
  custo,
  valorMinimo,
  clientes,
  avaliacao,
}) {
  return (
    <div className="card-fornecedores">
      <div className="logo-fornecedores">{logo}</div>
      <h2>{nome}</h2>
    </div>
  );
}
